const application={windowLoad:()=>{feather.replace();let copy=document.getElementById("copyDate");if(copy!==null)application.setCopyright(copy)},setCopyright:(el)=>{let dttm=(new Date).getFullYear();if(el.innerHTML!==dttm.toString())el.innerHTML=dttm.toString()}};if(document.readyState==="complete"||document.readyState!=="loading"&&!document.documentElement.doScroll)application.windowLoad();else document.addEventListener("DOMContentLoaded",application.windowLoad);
if("serviceWorker"in navigator)window.addEventListener("load",()=>{navigator.serviceWorker.register("../sw.js").catch((err)=>console.error(`Service Worker: Error: ${err}`))});